import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import '../nav/nav.css'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

function darkModeFunction(){
    var element = document.body;
    element.classList.toggle("dark-mode");
}

export default function Nav() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" className="nav">
        <Toolbar>
          <Typography variant="h5" className="title">STRANGERS OR NOT</Typography>
          <span className="buttonSpan">
            <Button size="medium" variant="outlined" className="toggleButtons">Toggle Colorblindness </Button>
            <Button size="medium" variant="outlined" className="toggleButtons" onClick={this.darkModeFunction()}>Toggle Dark Mode </Button>
          </span>
        </Toolbar>
      </AppBar>
    </div>
  );
}
